import React from 'react'
import { useNavigate } from 'react-router-dom';
import EmployeeServices from '../services/EmployeeServices';

const EmployeeList = () => {

    const navigate=useNavigate()
    const [employe, setEmploye] = useState(null);
    const [Loading, setLoading] = useState(true);
    
    useEffect(() => {
      const fetchData = async ()=>{
        setLoading(true);
        try {

          const response= await EmployeeServices.getEmployee();
          setEmployees(response.data);
          
        } catch (error) {
          console.log(error);
        }
        setLoading(false);
      }
      fetchData();

    }, []);

  return (
    <div className='container max-auto my-8'>
     <div  className='h-12 px-4'>
      <button onClick={()=>navigate("/addEmployee")} className='rounded bg-slate-600 text-white px-4 py-2 font-semibold '>
        Add Employee
      </button>
     </div>
     <div className='flex shadow border-b px-4'>
      <table className='min-w-full'>
        <thead className='bg-gray-50' >
          <tr>
            <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6 '>First Name</th> 
            <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6 '>Last Name</th>
            <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6 '>Email Id</th>
            <th className='text-right font-medium text-gray-500 uppercase tracking-wider py-3 px-6 '>Actions</th>
          </tr>

        </thead>
        {!Loading && (
        <tbody className='bg-white' >

            {employees.map((employees)=>( 
            <tr>
              <td className='ext-left px-6 py-4 whitespace-nowrap'>
                <div className='text-sm text-gray-500'>{employees.firstName}</div>
              </td>
              <td className='ext-left px-6 py-4 whitespace-nowrap'>
                <div className='text-sm text-gray-500'>{employees.lastName}</div>
              </td>
              <td className='ext-left px-6 py-4 whitespace-nowrap'>
                <div className='text-sm text-gray-500'>{employees.emailId}</div>
              </td>
              <td className='text-right font-medium text-sm text-gray-500 px-2'>
                <a href="#" className='text-indigo-600 hover:text-indigo-400 px-2' >Edit</a>
                <a href="#" className='text-indigo-600 hover:text-indigo-400 px-2' >Delete</a>

              </td>
             
            </tr>
             ))}
        </tbody>)}
        </table>
     </div>
    </div>
   
  )
}

export default EmployeeList;
